import React from 'react';
import "./Legal.css";

export default function Legal() {
    return (
        <div id="legal">
            <ul>
                <li key="l1">Use policy</li>
                <li key="l1">Privacy policy</li>
                <li>Cookies</li>
            </ul>
        </div>
    )
}
